void delete(k){
  int x, y, z = 0;

  while(1){
    if(T[z].key == k) break;
    else if(k < T[z].key) z = T[z].l[0];
    else z = T[z].l[1];
  }

  if(T[z].l[0] == -1 || T[z].l[1] == -1) y = z;
  else y = successor(z);

  if(T[y].l[0] != -1) x = T[y].l[0];
  else x = T[y].l[1];

  if(x != -1) T[x].p = T[y].p;

  if(T[y].p != -1){
    if(y == T[T[y].p].l[0]) T[T[y].p].l[0] = x;
    else T[T[y].p].l[1] = x;
  }

  if(y !=  z) T[z].key = T[y].key;

}
